import styled from "styled-components"
import waveImg from "../../assets/wave.png"

export default function WaveHeightDirection({a}) {

    return (
        <Content>
            <>
            {a.map((value, index) => (
                    <WaveImage
                        key={index}
                    />
                ))}
            </>
            <Information>
                {a.map((value, index) => (
                    <WHeight
                        key={index}
                        heigth={value. waveHeight}
                        direction={value.currentDirection}
                    />
                ))}
            </Information>
        </Content>
    )
}
function WaveImage(){
    return(
        <><img src={waveImg}/></>
    )
}

function WHeight({ heigth }) {
    console.log(heigth)
    return (
        <>{heigth}</>
    )
}
function WDirection({ direction }) {
    return (
        <>{direction}</>
    )
}
const Information=styled.div`
border: 2px solid red;
display: flex;
flex-direction: column;
`
const Content = styled.div`
border: 2px solid purple;
width: 100%;
`
